import ListItem from "./ListItem.js"

var React = require('react');

class List extends React.Component{


render(){
    

    const lista = this.props.ItemList;
    const todoItems = lista.map((obj) =>
  <tr key={obj.id}>
   <td> {obj.rut} </td>
    <td>{obj.fecha}</td>
   <td> {obj.equipo}</td>
    <td>{obj.equipamiento}</td>
  </tr>
);
    for (var i in lista){
        ruts.push(lista[i].rut)
        fechas.push(lista[i].fecha)
        equipos.push(lista[i].equipo)
        equipamientos.push(lista[i].equipamiento)
    }
    
    return (
        <Table striped bordered hover>
        <thead>
    <tr>
      <th>#</th>
      <th>First Name</th>
      <th>Last Name</th>
      <th>Username</th>
    </tr>
  </thead>
  <tbody>
  {todoItems}
</tbody>
</Table>
      );
    


}
}
export default List
